import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import Products from './components/Products';
import Suppliers from './components/Suppliers';
import Transactions from './components/Transactions';

// TODO: Add more features later - student project
// This is my inventory management system for the technical assessment
// I hope this works properly! 

function App() {
  // Student debugging - checking if component loads
  console.log('App component is loading...');
  console.log('Current time:', new Date().toLocaleString());
  
  // Using longer variable names like a beginner would
  const currentNavigationState = 'active';
  const applicationTitle = 'Mini Inventory Management System';
  const studentInformation = {
    name: 'Student Name',
    studentId: 'STU123456',
    course: 'Full-Stack Development',
    semester: 'Fall 2024'
  };

  // Function to handle navigation clicks (student-style)
  const handleNavigationClick = (pageName) => {
    console.log('User clicked on:', pageName);
    console.log('Navigating to page...');
    // TODO: Add analytics later
  };

  return (
    <Router>
      <div className="container">
        {/* Header with student information */}
        <header className="header">
          <h1>{applicationTitle}</h1>
          <div className="student-info">
            <p>By: {studentInformation.name} | ID: {studentInformation.studentId}</p>
            <p>{studentInformation.course} - {studentInformation.semester}</p>
            <p>Technical Assessment Project</p>
          </div>
        </header>

        {/* Navigation menu */}
        <nav className="nav">
          <Link to="/" onClick={() => handleNavigationClick('Dashboard')}>
            ðŸ“Š Dashboard
          </Link>
          <Link to="/products" onClick={() => handleNavigationClick('Products')}>
            ðŸ“¦ Products
          </Link>
          <Link to="/suppliers" onClick={() => handleNavigationClick('Suppliers')}>
            ðŸ‘¥ Suppliers
          </Link>
          <Link to="/transactions" onClick={() => handleNavigationClick('Transactions')}>
            ðŸ’° Transactions
          </Link>
        </nav>

        {/* Main content area */}
        <main>
          <Routes>
            <Route path="/" element={<Dashboard />} />
            <Route path="/products" element={<Products />} />
            <Route path="/suppliers" element={<Suppliers />} />
            <Route path="/transactions" element={<Transactions />} />
          </Routes>
        </main>

        {/* Footer with student info */}
        <footer className="inconsistent-spacing" style={{ textAlign: 'center', padding: '20px', color: '#666' }}>
          <p className="different-font-size">
            Â© 2024 {studentInformation.name} - Student Project
          </p>
          <p>Built with React.js, Node.js, Express.js, and MongoDB</p>
          <p>This is a learning project for inventory management</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
